import Main from "./components/Main/Main";
import { Link, Route, Routes } from "react-router-dom";
import Category from "./components/Category/CategoriesList";
import ProductsList from "./components/ProductList/ProductsList";
import CategoryTypes from "./components/categoryTypes/CategoryTypes";
import Product from "./components/ProductList/Product";
import Basket from "./components/Basket/Basket";

function App() {
  return (
    <div>
      <Routes>
        <Route path="/" element={<Main />} />
        <Route path="/products/all" element={<ProductsList />} />
        <Route path="/categories/:id" element={<CategoryTypes />} />
        <Route path="/products/:id" element={<Product />} />
        <Route path="/basket" element={<Basket />} />

        <Route path="/" element={<Category type="main" />} />
        <Route path="/categories/all" element={<Category type="page" />} />

        const categories = (type==='main') : useSelector().slice(0,4) :
        useSelector()

        {type === "main" && (
          <button>All ca</button>
        )}
        <div style={{ paddingTop: type === "main" ? 5 : 30 }}></div>
      </Routes>
    </div>
  );
}

export default App;
